import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the cart element (the clickable cart in header)
    await page.waitForSelector('.cart', { timeout: 5000 });

    // Click the cart to open the shopping cart modal
    await page.click('.cart');

    // Wait for the cart modal to appear (by id)
    await page.waitForSelector('#cartModal', { timeout: 5000 });

    // Wait for the cart modal to be visible (display: block)
    await page.waitForFunction(() => {
      const modal = document.getElementById('cartModal');
      return modal && window.getComputedStyle(modal).display === 'block';
    }, { timeout: 5000 });

    // Take screenshot of the open cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal_open.png'));

    // Extract cart modal title and cart items count for verification
    const cartModalTitle = await page.$eval('#cartModal .cart-content h2', el => el.textContent.trim());
    let cartItemsCount = 0;
    try {
      cartItemsCount = await page.$$eval('#cartItems .cart-item', els => els.length);
    } catch {
      // If cart is empty, cart-item may not exist
      cartItemsCount = 0;
    }

    return {
      success: true,
      action: "Opened the Shopping Cart modal and verified its visibility",
      extractedData: {
        cartModalTitle,
        cartItemsCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
